import React, {useState} from 'react';
import {Nav, Navbar, Row, NavDropdown, Container, Button} from "react-bootstrap";

const Filter = () => {
    const [light, setLight] = useState('light')
    const changeLight = ()=>{
        if (light == 'light'){
            setLight('dark');
        }else {
            setLight('light')
        }

    }
    return (
        <Navbar variant={light} bg={light} expand="lg">
            <Container fluid>

                <Navbar.Collapse>
                    <Nav>
                        <NavDropdown
                            id="nav-dropdown-dark-example"
                            title="Dropdown"
                            menuVariant="light"
                        >
                            <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                            <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
                            <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                            <NavDropdown.Divider />
                            <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
                        </NavDropdown>
                    </Nav>
                    <Nav>
                        <NavDropdown
                            id=""
                            title="Dropdown"
                            menuVariant="light"
                        >
                            <NavDropdown.Item onClick={()=>{changeLight()}}>Action</NavDropdown.Item>
                            <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
                            <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                            <NavDropdown.Divider />
                            <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
                        </NavDropdown>
                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
};

export default Filter;
